import React, { useState } from 'react'; // Keep this single import for React
import './Main.css';

const Main = ({ bus_id, bus_no, model }) => {
  const [formData, setFormData] = useState({
    username: '',
    service_date: '',
    last_date: '',
    services_done: [],
    bill: null,
    queries: '',
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === 'checkbox') {
      let updatedServices = [...formData.services_done];
      if (checked) {
        updatedServices.push(value);
      } else {
        updatedServices = updatedServices.filter((service) => service !== value);
      }
      setFormData({ ...formData, services_done: updatedServices });
    } else if (type === 'file') {
      setFormData({ ...formData, [name]: e.target.files[0] });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic, like sending data to backend
    console.log('Form submitted:', formData);
  };

  return (
    <div className='wh-cont'>
    <div id="form-wrapper">
      <form onSubmit={handleSubmit} encType="multipart/form-data">
        <center><h1>SERVICE RECORD</h1></center>
        <div align="left">
          <h3>
            <p><b>BUS ID: </b>{bus_id}</p>
            <p><b>BUS NO: </b>{bus_no}</p>
            <p><b>BUS MODEL: </b>{model}</p>
          </h3>
        </div>
        <label htmlFor="username"><strong>APPLICANT NAME(விண்ணப்பதாரர் பெயர்):</strong></label>
        <input
          type="text"
          placeholder="Name of the Applicant"
          id="sam"
          name="username"
          value={formData.username}
          onChange={handleChange}
          required
        /><br /><br />

        <label htmlFor="service_date"><strong>SERVICE DATE(சேவை தேதி):</strong></label>
        <input
          type="date"
          id="samm"
          name="service_date"
          value={formData.service_date}
          onChange={handleChange}
          required
        /><br /><br />

        <label htmlFor="last_date"><strong>NEXT DATE(அடுத்த தேதி):</strong></label>
        <input
          type="date"
          id="samm"
          name="last_date"
          value={formData.last_date}
          onChange={handleChange}
          required
        /><br /><br />

        <label htmlFor="services_done"><h4>SERVICES DONE (சேவைகள் முடிந்தது):</h4></label>
        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Oil changes and filter replacements."
            id="Oil changes and filter replacements."
            onChange={handleChange}
          />
          <label htmlFor="Oil changes and filter replacements.">Oil changes and filter replacements (எண்ணெய் மாற்றங்கள் மற்றும் வடிகட்டி மாற்றீடுகள்)</label>
        </div><br />

        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Brake inspections and repairs"
            id="Brake inspections and repairs"
            onChange={handleChange}
          />
          <label htmlFor="Brake inspections and repairs">Brake inspections and repairs (பிரேக் ஆய்வுகள் மற்றும் பழுது)</label>
        </div><br />

        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Engine tune-ups and repairs."
            id="Engine tune-ups and repairs."
            onChange={handleChange}
          />
          <label htmlFor="Engine tune-ups and repairs.">Engine tune-ups and repairs (என்ஜின் டியூன்-அப்கள் மற்றும் பழுது)</label>
        </div><br />

        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Transmission repairs and replacements."
            id="Transmission repairs and replacements."
            onChange={handleChange}
          />
          <label htmlFor="Transmission repairs and replacements.">Transmission repairs and replacements (பரிமாற்ற பழுது மற்றும் மாற்றீடுகள்)</label>
        </div><br />

        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Electrical system repairs and maintenance."
            id="Electrical system repairs and maintenance."
            onChange={handleChange}
          />
          <label htmlFor="Electrical system repairs and maintenance.">Electrical system repairs and maintenance (மின்சார அமைப்பு பழுது மற்றும் பராமரிப்பு)</label>
        </div><br />

        <div className="form-check">
          <input
            type="checkbox"
            name="services_done"
            value="Suspension system repairs and maintenance."
            id="Suspension system repairs and maintenance."
            onChange={handleChange}
          />
          <label htmlFor="Suspension system repairs and maintenance.">Suspension system repairs and maintenance (இடைநீக்க அமைப்பு பழுது மற்றும் பராமரிப்பு)</label>
        </div><br /><br />

        <label htmlFor="bill"><strong>BILL (ரசீது):</strong></label>
        <input
          type="file"
          id="billProof"
          name="bill"
          accept="image/*"
          onChange={handleChange}
          required
        /><br /><br />

        <label htmlFor="queries"><h4>ANY QUERIES (ஏதேனும் கேள்விகள்):</h4></label>
        <textarea
          id="queries"
          name="queries"
          className="form-control form-control-lg"
          placeholder="Leave a comment here"
          value={formData.queries}
          onChange={handleChange}
        ></textarea><br /><br />

        <button type="submit">SUBMIT</button>
      </form>
    </div>
    </div>
  );
};

export default Main;
